import WeatherContext from '../../Utils/WeatherContext'

function Cards({ data }) {

const context = useContext(WeatherContext)



  return (
      <div>
      <h3>Five Day Forcast</h3>
     {context.map((day, i) => (
        <p>{day.dt_txt.substring(0, 10)}</p>
     ))}
    </div>
  );
}

export default Cards;
